★スピードのメッシュバッグ！<br>
<br>
●濡れたままトレーニンググッズなどを入れて持ち運びができ、そのまま干せる使い勝手の良さが特徴！<br>
●しっかりとしたメッシュ素材に加え、紐の留め具が搭載され従来のモデルから更に使いやすくなりました！<br>
●デザインは色華やかなベース色にビッグロゴをプリント！１つ持っていると便利なバッグです！<br>
<br>
■素材<br>
本体：ポリエステル<br>
切替：合成皮革<br>
■企画製造販売元 株式会社ゴールドウィン<br>
<br>
